A re-interpretation of Ramayana, the Thai animation film tells the story of a 
giant robot, Na Kiew, who's left wandering in a barren wasteland after a great 
war. Na Kiew meets Jao Phuek, a puny tin robot who's lost his memory and is now 
stuck with his new big friend. Together they set out across the desert populated 
by metal scavengers, to look for Ram, the creator of all robots.

